        }
        .background.blurred {
            filter: blur(8px);
        }
        .timer-container {
            position: absolute;
            top: 0%;
            left: calc(100% - 438px);
            padding: 0.5rem 0.5rem;
            z-index: 1;
        }
        #timer {
            font-family: 'Built Titling', 'MS Trebuchet','Trebuchet MS', 'Lucida Sans Unicode', 'Lucida Grande', 'Lucida Sans', Arial, sans-serif;
            font-size: 10rem;
            text-transform: uppercase;
            font-weight: bold;
            margin: 0 0 1.5rem 0;
            letter-spacing: 0.1em;
            color: #000000;
        }
        /* Modal styles */
        #timerModal {
            display: none;
            position: fixed;
            z-index: 1000;
            left: 0; top: 0; right: 0; bottom: 0;
            justify-content: center;
            align-items: center;
            width: 100vw;
            height: 100vh;
        }
        #timerModal .modal-overlay {
            position: absolute;
            left: 0; top: 0; right: 0; bottom: 0;
            background: rgba(0,0,0,0.5);
            z-index: 0;
        }
        #timerModal .modal-content {
            position: relative;
            z-index: 1;
            background: #222;
            color: #fff;
            padding: 2em 2em 1.5em 2em;
            border-radius: 10px;
            box-shadow: 0 4px 32px rgba(0,0,0,0.4);
            min-width: 300px;
            max-width: 90vw;
            text-align: center;
        }
        #timerModal input[type="number"] {
            width: 60px;
            font-size: 1.2em;
            margin: 0 0.5em;
            padding: 0.2em 0.4em;
            border-radius: 4px;
            border: 1px solid #888;
            background: #111;
            color: #fff;
        }
        #timerModal button {
            margin: 0.5em 0.3em;
            padding: 0.5em 1.2em;
            border: none;
            border-radius: 4px;
            background: #444;
            color: #fff;
            font-size: 1em;
            cursor: pointer;
            transition: background 0.2s;
        }
        #timerModal button:hover {
            background: #666;
        }
        body.modal-open {
            overflow: hidden;
        }

    </style>
</head>
<body>
    <div class="background"></div>
    <div class="timer-container">

    <div id="timerModal" style="display:none;">
        <div class="modal-overlay"></div>
        <div class="modal-content">
            <h2>Set Timer</h2>
            <form id="timerForm">
                <label for="timerInput">Minutes:</label>
                <input type="number" id="timerInput" min="0" max="999" value="90" />
                <button type="submit">Set</button>
            </form>
            <button id="resetTimerBtn">Reset to 90:00</button>
            <button id="closeModalBtn">Close</button>
        </div>
    </div>
    <script>
        const timerDisplay = document.getElementById('timer');
        const milestoneSound = document.getElementById('milestoneSound');

        let totalSeconds = 90 * 60; // 90 minutes
        let milestoneSeconds = [80, 70, 60, 50, 45, 40, 35, 30, 20, 10].map(x => x * 60);
        let currentSeconds = totalSeconds;
        let timerInterval = null;

        function formatTime(seconds) {
            const m = Math.floor(seconds / 60);
            const s = seconds % 60;
            return `${m}:${s.toString().padStart(2, '0')}`;
        }

        function updateTimerDisplay() {
            timerDisplay.textContent = formatTime(currentSeconds);
        }

        function setTimerCookie(seconds) {
            document.cookie = `alice_timer=${seconds}; path=/; max-age=604800`;
        }

        function getTimerCookie() {
            const match = document.cookie.match(/(?:^|; )alice_timer=(\d+)/);
            return match ? parseInt(match[1], 10) : null;
        }

        function setBackgroundBlur(blur) {
            const bg = document.querySelector('.background');
            if (blur) {
                bg.classList.add('blurred');
            } else {
                bg.classList.remove('blurred');
            }
        }

        // On load, check for cookie
        const savedSeconds = getTimerCookie();
        if (savedSeconds !== null && savedSeconds <= totalSeconds && savedSeconds >= 0) {
            currentSeconds = savedSeconds;
            startTimer();
        }
        updateTimerDisplay();

        function startTimer() {
            if (timerInterval) return;
            timerInterval = setInterval(() => {
                if (currentSeconds > 0) {
                    currentSeconds--;
                    updateTimerDisplay();
                    setTimerCookie(currentSeconds);
                    if (milestoneSeconds.includes(currentSeconds)) {
                        milestoneSound.play();
                    }
                } else {
                    clearInterval(timerInterval);
                    timerInterval = null;
                    setTimerCookie(0);
                }
            }, 1000);
        }

        function resetTimer() {
            clearInterval(timerInterval);
            timerInterval = null;
            currentSeconds = totalSeconds;
            setTimerCookie(currentSeconds);
            updateTimerDisplay();
        }

        timerDisplay.addEventListener('click', () => {
            if (timerInterval) {
                clearInterval(timerInterval);
                timerInterval = null;
                setBackgroundBlur(true);
            } else {
                startTimer();
                setBackgroundBlur(false);
            }
        });

        document.addEventListener('keydown', (e) => {
            if (e.code === 'Space') {
                e.preventDefault();
                if (timerInterval) {
                    clearInterval(timerInterval);
                    timerInterval = null;
                    setBackgroundBlur(true);
                } else {
                    startTimer();
                    setBackgroundBlur(false);
                }
                return;
            }
            if (e.code === 'Escape') {
                const modal = document.getElementById('timerModal');
                if (modal && modal.style.display === 'flex') {
                    hideTimerModal();
                } else {
                    showTimerModal();
                }
                return;
            }
        });

        // On load, set blur state based on timer
        setBackgroundBlur(!timerInterval);

        updateTimerDisplay();

        function showTimerModal() {
            document.getElementById('timerModal').style.display = 'flex';
            setBackgroundBlur(true);
            document.body.classList.add('modal-open');
            document.getElementById('timerInput').focus();
        }

        function hideTimerModal() {
            const modal = document.getElementById('timerModal');
            if (modal) modal.style.display = 'none';
            setBackgroundBlur(!!timerInterval ? false : true);
            document.body.classList.remove('modal-open');
        }

        document.addEventListener('DOMContentLoaded', () => {
            const modal = document.getElementById('timerModal');
            const overlay = modal.querySelector('.modal-overlay');
            const closeBtn = document.getElementById('closeModalBtn');
            const form = document.getElementById('timerForm');
            const input = document.getElementById('timerInput');
            const resetBtn = document.getElementById('resetTimerBtn');

            overlay.onclick = hideTimerModal;
            closeBtn.onclick = hideTimerModal;
            form.onsubmit = function(e) {
                e.preventDefault();
                let mins = parseInt(input.value, 10);
                if (!isNaN(mins) && mins >= 0 && mins <= 999) {
                    currentSeconds = mins * 60;
                    setTimerCookie(currentSeconds);
                    updateTimerDisplay();
                    hideTimerModal();
                }
            };
            resetBtn.onclick = function() {
                currentSeconds = totalSeconds;
                setTimerCookie(currentSeconds);
                updateTimerDisplay();
                hideTimerModal();
            };
        });
    </script>
</body>
</html>
